function AdminOrdersTable({ orders }) {
  return orders ? (
    <table>
      <tbody>
        <tr>
          <th>order id</th>
          <th>order total</th>
        </tr>
        {orders.data.OrderFind.map((order) => {
          return (
            <tr key={"order" + order._id}>
              <td>{order._id}</td>
              <Link>{order._id}</Link>
              <td>{order.total}</td>
            </tr>
          );
        })}
      </tbody>
    </table>
  ) : (
    <>Wait...</>
  );
}
export default AdminOrdersTable;
